Creating a drag-and-drop Kanban board in React involves several steps, including setting up state, implementing React DnD (Drag and Drop) using a library like `react-dnd` or `react-beautiful-dnd`, and designing the component structure. Here's a high-level overview of building a simple drag-and-drop Kanban board using `react-beautiful-dnd`:

1. Install `react-beautiful-dnd`:

```bash
npm install react-beautiful-dnd
```

2. Import necessary components in your main App file:

```jsx
import React from 'react';
import { DndProvider } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';

// Your components
import Board from './components/Board';
import Column from './components/Column';

function App() {
  return (
    <DndProvider backend={HTML5Backend}>
      <Board />
    </DndProvider>
  );
}

export default App;
```

3. Create a `Board` component:

```jsx
import React from 'react';
import { useCallback } from 'react';
import { DragDropContext, Droppable } from 'react-dnd';
import { useDrop } from 'react-dnd';
import Column from './Column';

function Board() {
  const [columns, setColumns] = React.useState([
    {
      id: 1,
      title: 'To Do',
      tasks: [{ id: 1, content: 'Task 1' }],
    },
    {
      id: 2,
      title: 'In Progress',
      tasks: [{ id: 2, content: 'Task 2' }],
    },
    {
      id: 3,
      title: 'Done',
      tasks: [{ id: 3, content: 'Task 3' }],
    },
  ]);

  const onDragEnd = useCallback((result) => {
    const { destination, source } = result;

    if (!destination || !source) return;

    if (destination.droppableId === source.droppableId && destination.index === source.index) return;

    const column = columns[source.droppableId - 1];
    const task = column.tasks[source.index];

    setColumns((prevColumns) => {
      const newColumnTasks = [...column.tasks];
      newColumnTasks.splice(source.index, 1);

      const newTasksOrder = [...prevColumns[destination.droppableId - 1].tasks];
      newTasksOrder.splice(destination.index, 0, task);

      return prevColumns.map((column, index) => ({ ...column, tasks: newTasksOrder }));
    });
  }, [columns]);

  useDrop({
    drop: (item, monitor) => {
      const { index: destinationIndex } = destination;
      const { index: sourceIndex } = source;

      if (destinationIndex === sourceIndex) return;

      onDragEnd({ source: { index: sourceIndex }, destination: { index: destinationIndex } });
      monitor.item.isDragging = false;
    },
    collect: (monitor) => ({
      droppable: {
        isOver: !!monitor.isOver(),
        isActive: monitor.isActive(),
      },
      item: monitor.getItem(),
      source: monitor.getItem()?.source,
    }),
  });

  return (
    <Droppable droppableId="0" direction="horizontal">
      {(provided) => (
        <div
          ref={provided.innerRef}
          {...provided.droppableProps}
          style={provided.droppableStyle}
        >
          {columns.map((column) => (
            <Column
              key={column.id}
              id={column.id}
              title={column.title}
              tasks={column.tasks}
            />
          ))}
          {provided.placeholder}
        </div>
      )}
    </Droppable>
  );
}

export default Board;
```

4. Create a `Column` component:

```jsx
import React from 'react';
import { useDrag } from 'react-dnd';

function Column({ id, title, tasks }) {
  // ...
  // Your custom styles and logic for columns go here

  // Drag and drop logic for tasks:

  const [{ isDragging }, drag] = useDrag({
    item: { id: task.id, type: 'task', index: taskIndex },
    collect: (monitor) => ({
      isDragging: monitor.isDragging(),
    }),
  });

  return (
    <div ref={drag} className={`column-container ${isDragging ? 'is-dragging' : ''}`}>
      <h3>{title}</h3>
      <div className="tasks-container">
        {tasks.map((task, taskIndex) => (
          <Task key={task.id} id={task.id} content={task.content} />
