1. Prototype: In Swift, a prototype is not a built-in concept. Instead, it refers to creating an instance of a custom class or struct as a starting point for duplicating and modifying new instances.

For example, let's create a CustomView class that has properties for a label and an image. We'll make a prototype instance and see how we can customize it.

```swift
class CustomView: UIView {
    var titleLabel: UILabel!
    var imageView: UIImageView!

    override init(frame: CGRect) {
        super.init(frame: frame)
        commonInit()
    }

    required init?(coder aDecoder: NSCoder) {
        super.init(coder: aDecoder)
        commonInit()
    }

    func commonInit() {
        titleLabel = UILabel()
        titleLabel.translatesAutoresizingMaskIntoConstraints = false
        titleLabel.text = "Custom View"
        self.addSubview(titleLabel)

        imageView = UIImageView()
        imageView.translatesAutoresizingMaskIntoConstraints = false
        imageView.image = UIImage(named: "exampleImage")
        self.addSubview(imageView)

        NSLayoutConstraint.activate([
            titleLabel.centerXAnchor.constraint(equalTo: self.centerXAnchor),
            titleLabel.topAnchor.constraint(equalTo: self.topAnchor, constant: 10),

            imageView.centerXAnchor.constraint(equalTo: self.centerXAnchor),
            imageView.topAnchor.constraint(equalTo: titleLabel.bottomAnchor, constant: 10),
            imageView.widthAnchor.constraint(equalTo: self.widthAnchor, multiplier: 0.5),
            imageView.heightAnchor.constraint(equalTo: self.heightAnchor, multiplier: 0.5)
        ])
    }
}
```

Once you create CustomView in your storyboard, you can create an outlet and use code like this to reference the prototype instance, and then modify it as needed:

```swift
let customView = storyboard.instantiateViewController(withIdentifier: "CustomView") as! CustomView
customView.titleLabel.text = "New Title"
```

2. Delegate: A delegate is a pattern in Swift that allows communication between classes. One class, called the delegate, will have a reference to an instance of another class, and it agrees to be notified and perform certain actions when specific events occur in the second class.

For example, let's create a `TableViewCell` with a button:

```swift
class TableViewCell: UITableViewCell {
    @IBOutlet weak var myButton: UIButton!
    weak var delegate: TableViewCellDelegate?

    @IBAction func buttonTapped(_ sender: UIButton) {
        delegate?.tableViewCellDidTap(_: self)
    }
}
```

First, we set up an outlet for our button, and we declare a `TableViewCellDelegate` protocol, which defines a single method `tableViewCellDidTap(_:)`.

In the button's action, we call the `tableViewCellDidTap(_:)` method on our delegate, passing self as an argument.

Next, let's look at our TableViewController, where we set ourselves as the delegate for our TableViewCell instances:

```swift
class TableViewController: UITableViewController, TableViewCellDelegate {
    override func tableView(_ tableView: UITableView, cellForRowAt indexPath: IndexPath) -> UITableViewCell {
        let cell = tableView.dequeueReusableCell(withIdentifier: "MyCell", for: indexPath)
        cell.delegate = self

        // configure the cell here
        return cell
    }

    func tableViewCellDidTap(_ cell: TableViewCell) {
        print("Cell tapped!")
    }
}
```

In the `tableView(_:cellForRowAt:)` method, we set our TableViewController as the delegate for our TableViewCell instances, and then we can respond to button taps in the `tableViewCellDidTap(_:)` method.

