<Application.Resources>
    <local:BooleanInverseConverter x:Key="InverseBooleanConverter"/>
</Application.Resources>
```

Now, create the `BooleanInverseConverter.cs`:

```csharp
using System;
using System.Globalization;

namespace StopwatchApp.Converters
{
    public sealed class BooleanInverseConverter : BaseValueConverter
    {
        public override object Convert(object value, Type targetType, object parameter, string language)
        {
            bool booleanValue;
            if (value is bool boolean && Boolean.TryParse(parameter, out booleanValue))
            {
                return !booleanValue;
            }
            return null;
        }

        public override object ConvertBack(object value, Type targetType, object parameter, string language)
        {
            bool booleanValue;
            if (value is bool boolean && Boolean.TryParse(parameter.ToString(), out booleanValue))
            {
                return !booleanValue;
            }
            return null;
        }
    }
}
```

