            {
                timer.Stop();
                StartStopButton.Content = "Start";
            }
            else
            {
                timer.Start();
                StartStopButton.Content = "Stop";
            }
        }

        private void Reset_Click(object sender, RoutedEventArgs e)
        {
            time = TimeSpan.Zero;
            StopwatchTextBlock.Text = "00:00:00";
            timer.Stop();
        }
    }
}
```

This simple stopwatch demonstrates the basic functionality for a XAML page. When you run the application, you should be able to start, stop, and reset the stopwatch.

