# Building a Chrome Extension: A Comprehensive Guide for Computer Science Students

This guide will walk you through the process of creating a custom Chrome extension, focusing on creating an extension that interacts with Google APIs. By the end of this guide, you'll have a solid understanding of how Chrome extensions work and be able to create your own extensions with confidence.

## Table of Contents
1. [Introduction](#introduction)
2. [Project Overview and Functionality](#project-overview-and-functionality)
3. [Preparation](#preparation)
    3.1 [Setting up your development environment](#setting-up-your-development-environment)
    3.2 [Creating a new Chrome Extension project](#creating-a-new-chrome-extension-project)
4. [Manifiest File](#manifest-file)
5. [Service Worker (Optional)](#service-worker-optional)
6. [Content Script](#content-script)
7. [Popup](#popup)
8. [Options Page](#options-page)
9. [Icons](#icons)
10. [Google API Integration](#google-api-integration)
11. [Testing](#testing)
12. [Packaging and Distribution](#packaging-and-distribution)
13. [Additional Resources](#additional-resources)
14. [Conclusion](#conclusion)

<a name="introduction"></a>
## 1. Introduction

A Chrome extension is a type of software component that adds a specific feature to the Chrome browser. In this guide, we will be creating an extension that interacts with Google APIs to demonstrate its functionality. This guide assumes you have a basic understanding of HTML, CSS, and JavaScript.

<a name="project-overview-and-functionality"></a>
## 2. Project Overview and Functionality

For this project, we will create a Chrome extension that allows users to search for images using a provided keyword and display the results within the browser. We will also provide options for users to customize the behavior of the extension.

<a name="preparation"></a>
## 3. Preparation

<a name="setting-up-your-development-environment"></a>
### 3.1 Setting up your development environment

Before we start building our extension, ensure you have the following tools installed:

- [Google Chrome](https://www.google.com/chrome/): The browser in which we will be testing our extension.
- [Node.js](https://nodejs.org/en/download/): A JavaScript runtime that will help us manage our project and automate tasks.
- [Chrome Extension Developer Toolkit for Visual Studio Code](https://marketplace.visualstudio.com/items?itemName=jhe.vscode-chrome-extension): A set of tools for Visual Studio Code that simplifies the development of Chrome extensions.

Once you have these tools installed, you can start setting up your project.

<a name="creating-a-new-chrome-extension-project"></a>
### 3.2 Creating a new Chrome Extension project

1. Open Visual Studio Code and create a new folder for your project.
2. Open the terminal and navigate to the project folder.
3. Run `yo chrome-extension` to create a new Chrome extension project. If you don't have `yo` installed, you'll need to install it first by running `npm install -g yo`.
4. Answer the prompts as follows:
    - Name of your extension: `ImageSearch`
    - Chrome version for the manifest file: Enter the latest major version number (e.g. 97)
    - Add a popup: `yes`
    - Add an options page: `yes`
    - Add content scripts: `yes`

During this process, yo will create the required structure for your project, including the `manifest.json`, `popup`, `options`, and `content_scripts` folders.

<a name="manifest-file"></a>
## 4. Manifest File

The `manifest.json` file is the central configuration file for your extension, enabling it to communicate with the Chrome browser and define its permissions, content scripts, and other settings.

```json
{
  "manifest_version": 3,
  "name": "Image Search",
  "version": "1.0",
  "action": {
    "default_popup": "popup/popup.html",
    "default_icon": {
      "16": "icons/icon16.png",
      "48": "icons/icon48.png",
      "128": "icons/icon128.png"
    },
    "default_title": "Image Search"
  },
  "permissions": ["activeTab", "https://www.googleapis.com/*"],
  "background": {
    "service_worker": "background/service-worker.js"
  },
  "content_scripts": [
    {
      "matches": ["*://*/*"],
      "js": ["content_scripts/content-script.js"]
    }
  ],
  "options_page": "options/options.html",
  "browser_action": {
    "default_icon": {
      "16": "icons/icon16.png",
      "48": "icons/icon48.png",
      "128": "icons/icon128.png"
    }
  }
}
```

- The `manifest_version` defines the version of the manifest file structure.
- `name`, `version`, and `description` provide basic information about your extension.
- The `action` section defines the default behavior when users click the extension's icon, such as opening the popup.
- The `permissions` array lists the extensions' required permissions, in this case, access to the active tab and Google APIs.
- The `background` section specifies the service worker responsible for handling background tasks.
- The `content_scripts` array declares a content script that will be injected into all pages.
- The `options_page` specifies the HTML file for the options page.
- The `browser_action` section defines the default icons for the extension.

<a name="service-worker-optional"></a>
## 5. Service Worker (Optional)

A Service Worker is a JavaScript file that helps manage your extension's background tasks, such as handling network requests, caching resources, and notifying the popup of events. It can operate even when the browser is not active.

In our example, we'll create a simple Service Worker that listens for a message from the content script and initiates a search using Google's Image Search API.

Create a new file called `background/service-worker.js` and paste the following code:

```javascript
self.onMessageExternal = function(request, sender, sendResponse) {
  // Check if the request contains the correct event and keyword
  if (request.event === 'image-search' && request.keyword) {
    // Fetch images using Google Image Search API
    fetch('https://www.googleapis.com/customsearch/v1', {
      method: 'GET',
      headers: {
        'Authorization': `Google ${chrome.runtime.getManifest().apiKey}`,
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        key: chrome.runtime.getManifest().apiKey,
        cx: 'YOUR_CX_ID', // Replace with your Custom Search Engine ID
        q: request.keyword,
        searchType: 'image'
      })
    })
      .then(response => response.json())
      .then(data => {
        // Send the search results to the popup
        chrome.runtime.sendMessage({ event: 'image-search-results', data });
      })
      .catch(error => {
        console.error(error);
      });
  }
};
```

Replace `YOUR_CX_ID` with your Custom Search Engine ID, which you can obtain from [Google's Custom Search Engine API console](https://console.developers.google.com/flows/enableapi?apiid=customsearch&hl=en).

<a name="content-script"></a>
## 6. Content Script

Content scripts execute within the context of the web page they're injected into, allowing them to interact with DOM elements and manipulate the page's content. In our case, we'll create a content script that adds a button to web pages, allowing users to initiate an image search.

Create a new file called `content_scripts/content-script.js` and paste the following code:

```javascript
const searchButton = document.createElement('button');
searchButton.textContent = 'Search Images';
searchButton.addEventListener('click', () => {
  const keywordInput = document.createElement('input');
  keywordInput.type = 'text';
  keywordInput.value = '';

  const searchForm = document.createElement('form');
  searchForm.appendChild(keywordInput);
  searchForm.appendChild(searchButton);

  keywordInput.addEventListener('submit', event => {
    event.preventDefault();

    const keyword = keywordInput.value;

    // Send a message to the service worker to initiate the search
    chrome.runtime.sendMessage({ event: 'image-search', keyword });
  });

  document.body.appendChild(searchForm);
});

document.body.appendChild(searchButton);
```

<a name="popup"></a>
## 7. Popup

The popup is the window that appears when users click on the extension's icon. This is where we'll display the search results.

Create a new file called `popup/popup.html` and paste the following code:

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Image Search</title>
</head>
<body>
  <h1>Image Search Results</h1>
  <div id="search-results"></div>

  <script src="popup.js"></script>
</body>
</html>
```

Create another file called `popup/popup.js` and paste the following code:

```javascript
// Receive messages from the service worker and update the search results container
chrome.runtime.onMessageExternal.addListener(function(request, sender, sendResponse) {
  if (request.event === 'image-search-results') {
    const searchResults = document.getElementById('search-results');
    request.data.items.forEach(item => {
      const result = document.createElement('a');
      result.href = item.link;
      result.target = '_blank';
      result.textContent = item.title;

      const img = document.createElement('img');
      img.src = item.image.thumbnailLink;
      img.alt = item.title;
      result.appendChild(img);

      searchResults.appendChild(result);
    });
  }
});
```

<a name="options-page"></a>
## 8. Options Page

The options page provides users with settings to customize the extension.

Create a new file called `options/options.html` and paste the following code:

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Image Search Options</title>
</head>
<body>
  <h1>Image Search Options</h1>
  <!-- Add options fields and listener code here -->
</body>
</html>
```

You can customize this page to add form fields and event listeners as needed.

<a name="icons"></a>
## 9. Icons

Icons are used to represent the extension in various places, such as the extension's icon, the popup, and the options page. Make sure to create 16x16, 48x48, and 128x128 pixel icons and place them in the `icons` folder created during project setup.

<a name="google-api-integration"></a>
## 10. Google API Integration

As mentioned earlier, we'll use the Google Custom Search Engine API to fetch images for our extension. You can find the documentation and API references [here](https://developers.google.com/custom-search/v1/getting_started).

<a name="testing"></a>
## 11. Testing

To test your extension, load the unpacked extension in Chrome:

1. Open Chrome and navigate to `chrome://extensions`.
2. Enable Developer mode by toggling the switch in the top right corner.
3. Click "Load unpacked" and select your project folder.

Your extension should now be loaded, and you can test it on any webpage.

<a name="packaging-and-distribution"></a>
## 12. Packaging and Distribution

Once you're satisfied with your extension, you can package it for distribution. You can find the official guide on packaging extensions [here](https://developer.chrome.com/docs/extensions/mv3/package/).

<a name="additional-resources"></a>
## 13. Additional Resources

- [Official Chrome Extensions documentation](https://developer.chrome.com/docs/extensions/)
- [Google Custom Search Engine API documentation](https://developers.google.com/custom-search/v1/overview)

<a name="conclusion"></a>
## 14. Conclusion

Congratulations! You've now created a fully functional Chrome extension. Building extensions provides a valuable opportunity to dive deeper into web development, APIs, and user interface design. Keep exploring, and remember to continually refine and add features to your projects. Happy coding!

