import React, { useState } from 'react';
import { View, Button, Image } from 'react-native';
import { Camera } from 'react-native-camera';

const TakePicture = ({ navigation }) => {
  const [cameraRef, setCameraRef] = useState(null);

  const takePicture = async () => {
    if (cameraRef) {
      const photo = await cameraRef.takePictureAsync();
      navigation.navigate('PicturePreview', { photo });
    }
  };

  return (
    <Camera ref={ref => setCameraRef(ref)} style={{ flex: 1 }} type={Camera.Constants.Type.back}>
      <View style={{ flex: 1, backgroundColor: 'transparent', flexDirection: 'row' }}>
        <View style={{ flex: 0.1, flexDirection: 'row', backgroundColor: 'transparent' }}>
          <Button title="Take Picture" onPress={takePicture} color="#ffffff" />
        </View>
      </View>
    </Camera>
  );
};

export default TakePicture;
```

This code creates a camera component with a button that takes pictures. The picture is then navigated to another screen for preview.

Don't forget to handle the navigation part and create the `PicturePreview` component to display the taken picture.

