  const worksheet = workbookStream.Req.CurrentSheet;
  const data = XLSX.utils.sheet_to_json(worksheet, { raw: true });

  console.log(data);
});
```

In this example, `fs` is the built-in Node.js file system module. If you're using a different way to read files, just replace the `fs.createReadStream` call with your preferred method.

