import React from 'react';
import { renderHook, act } from '@testing-library/react-hooks';
import { useClickAway } from './use-click-away';
import { fireEvent, render } from '@testing-library/react';
import '@testing-library/jest-dom/extend-expect';
import JSXRenderer from 'jsx-renderer';
import { JSDOM } from 'jsdom';

describe('useClickAway', () => {
  let container: HTMLDivElement;
  let refMock: React.RefObject<HTMLDivElement>;

  beforeEach(() => {
    container = document.createElement('div');
    document.body.appendChild(container);

    refMock = { current: container };
  });

  afterEach(() => {
    document.body.removeChild(container);
    JSXRenderer.detach();
    JSDOM.cleanup();
  });

  it('should call onClickAway when clicking outside the referenced element', () => {
    const onClickAway = jest.fn();

    renderHook(() => useClickAway({ ref: refMock, onClickAway }));

    act(() => {
      fireEvent.click(container);
    });

    expect(onClickAway).not.toHaveBeenCalled();

    act(() => {
      fireEvent.mouseDown(document.body);
    });

    expect(onClickAway).toHaveBeenCalled();
  });

  it('should not call onClickAway when clicking inside the referenced element', () => {
    const onClickAway = jest.fn();

    renderHook(() => useClickAway({ ref: refMock, onClickAway }));

    act(() => {
      fireEvent.click(container);
      fireEvent.mouseDown(container);
    });

    expect(onClickAway).not.toHaveBeenCalled();
  });

  it('should not call onClickAway if shouldTriggerClickAway is false', () => {
    const onClickAway = jest.fn();

    renderHook(() => useClickAway({ ref: refMock, onClickAway, shouldTriggerClickAway: false }));

    act(() => {
      fireEvent.click(container);
      fireEvent.mouseDown(document.body);
    });

    expect(onClickAway).not.toHaveBeenCalled();
  });

  it('should remove the event listener on unmount', () => {
    let removeEventListenerSpy: jest.SpyInstance;

    const onClickAway = jest.fn();

    JSXRenderer.render(
      <div data-testid="root">
        <div data-testid="clickable" ref={refMock} />
      </div>,
      container,
    );

    renderHook(() => useClickAway({ ref: refMock as any, onClickAway }));

    removeEventListenerSpy = jest.spyOn(document, 'removeEventListener');

    act(() => {
      fireEvent.click(container);
      fireEvent.mouseDown(document.body);
    });

    expect(onClickAway).toHaveBeenCalledTimes(1);

    // Unmount the component
    JSDOM.current.window.document.body.removeChild(
