      onClickAway: mockOnClickAway,
      shouldTriggerClickAway: false,
    }));

    act(() => {
      document.body.click();
    });

    expect(mockOnClickAway).toHaveBeenCalledTimes(0);
  });

  it('should add/remove event listener on mount/unmount', () => {
    const { rerender, unmount } = renderHook(({ shouldTriggerClickAway }) => useClickAway({
      ref: useRef(document.createElement('div')),
      onClickAway: mockOnClickAway,
      shouldTriggerClickAway,
    }));

    rerender({ shouldTriggerClickAway: true });
    act(() => {
      document.body.click();
    });
    expect(mockOnClickAway).toHaveBeenCalledTimes(1);

    unmount();

    act(() => {
      document.body.click();
    });
    expect(mockOnClickAway).toHaveBeenCalledTimes(1);
  });
});
