I will provide you with a simple example using HTML, CSS, and JavaScript to adjust the width of an iframe based on the viewport size. This code will set the iframe width to 360px for screens smaller than 640px, 720px between 640px and 1023px, and 1400px for screens larger than 1024px.

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    #my-iframe {
      width: 100%;
      height: 500px;
      border: none;
    }
  </style>
  <script>
    window.addEventListener('resize', adjustIframe);
    adjustIframe();

    function adjustIframe() {
      const viewportWidth = Math.max(document.documentElement.clientWidth, window.innerWidth || 0);

      if (viewportWidth < 640) {
        document.getElementById("my-iframe").style.width = "360px";
      } else if (viewportWidth <= 1024) {
        document.getElementById("my-iframe").style.width = "720px";
      } else {
        document.getElementById("my-iframe").style.width = "1400px";
      }
    }
  </script>
</head>
<body>
  <iframe id="my-iframe" src="https://example.com"></iframe>
</body>
</html>
```

Replace `https://example.com` with the source for your iframe content.

