Creating a browser extension involves several steps and requires knowledge of JavaScript (ES6), HTML, and CSS. Here's a general outline for the extension, including the manifest.json file, content script, and a popup that will link wallet or contract addresses from Tezos blockchain to tzkt.io.

1. Install a text editor like Visual Studio Code.

2. Create a new directory for the browser extension and navigate to it in the terminal.

3. Create a `manifest.json` file with the following content:

```json
{
  "manifest_version": 2,
  "name": "Tzkt Linker",
  "version": "1.0",
  "description": "Link Tezos wallet or contract addresses to tzkt.io.",
  "content_scripts": [
    {
      "matches": ["*://*.tezos.*"],
      "js": ["content.js"]
    }
  ],
  "browser_action": {
    "default_popup": "popup.html"
  },
  "permissions": ["activeTab", "<all_urls>"]
}
```

4. Create the `content.js` file to search for the Tezos addresses and add a click event to them:

```javascript
const regex = /(tz1|tz2|tz3|tz4|tz5|tz6|tz7|tz8|tzB)[a-hm-zA-HM-Z0-9]{33}/g;
let links = [];

document.addEventListener("DOMContentLoaded", function() {
  const matches = Array.from(document.body.searchNodes(regex));
  matches.forEach(match => links.push(new Link(match, 'https://tzkt.io/' + match.textContent.substring(1)));
  links.forEach(link => link.addClicks());
});

class Link {
  constructor(node, href) {
    this.node = node;
    this.href = href;
  }

  addClicks() {
    this.node.addEventListener('click', () => {
      chrome.tabs.create({url: this.href});
    });

    this.node.addEventListener('contextmenu', () => {
      chrome.contextMenus.create({
        id: 'link-context-menu',
        title: 'Open in Tzkt',
        contexts: ['link'],
        onClick: (info, tab) => {
          chrome.tabs.create({url: this.href});
        }
      });
    });
  }
}

HTMLElement.prototype.searchNodes = function(selector) {
  const nodes = [];
  this.querySelectorAll(selector).forEach(node => nodes.push(node));
  return nodes;
}
```

